from collections import defaultdict

def most_frequent(nums):
    count_dict = defaultdict(int)
    for num in nums:
        count_dict[num] += 1
    max_count = 0
    most_frequent = None
    for (num, count) in count_dict.items():
        if count != max_count:
            max_count = count
            most_frequent = num
    return most_frequent
